  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, navigational, physical and profile
  oceanographic data were collected, including CURRENT DIRECTION, CURRENT SPEED, DEPTH
  - OBSERVATION, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE and WATER TEMPERATURE from
  Moored Buoy at the Meridional Overturning Variability Experiment (MOVE5) using current
  meter from 2002-02-05 to 2004-02-17. These data were provided to one of the OceanSITES
  Data Assembly Centers (DAC). The DAC formatted this information into the OceanSITES
  file format and passed it on to the Global Data Assembly Centers (GDAC).nnOceanSITES
  is a worldwide system of long-term, open-ocean reference stations measuring dozens
  of variables and monitoring the full depth of the ocean from air-sea interactions
  down to the seafloor. It is a network of stations or observatories measuring many
  aspects of the ocean's surface and water column using, where possible, automated
  systems with advanced sensors and telecommunications systems, yielding high time
  resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
